(1, 'Alwyn Roshan Pais', '1234', 'Faculty', ' \r\n0824- 2473407', '1997-12-31', '7', 'Associate Professor & Head of the Department', 'ORCID iD: \r\nhttps://orcid.org/0000-0003-4571-4608\r\nSCOPUS ID: \r\n23985907200\r\nGoogle Scholar: \r\nhttps://scholar.google.com/citations?user=5MD_e_wAAAAJ&hl=en', 'Ph.D, National Institute of Technology Karnataka, Surathkal, 2014.\r\n\r\nM.Tech, Indian Institute of Technology, Bombay, 2004.\r\n\r\nB. Tech, Mangalore University, 1995.', 'Algorithms, Complexity Analysis.', 'Chief Investigator\r\n\r\nInformation Security Education and Awareness Project Phase II (2015 - 2020), MCIT - New Delhi (Rs. 2.7 Crore)\r\nInformation Security Education and Awareness Project (2004 - 2014), MCIT- New Delhi  (Rs. 1.3 Crore)\r\nDevelopment of Tool for Detection of SQL Injection vulnerability in Web Applications (2010 - 2012), MCIT - New Delhi (Rs. 33.22 Lakhs)\r\nCo-Investigator\r\n\r\nDesign, Analysis and Implementation of Pilot PKI architecture and Virtual Network Services (2002 - 05), MHRD R&D (Rs. 8.00 Lakhs) \r\nModernisation and creation of Infrastructure for research and training in Internet Technologies and Electronic Commerce (2002 - 04), MHRD (Rs. 9.00 Lakhs)\r\nModernisation and creation of Infrastructure for Research and Training in Hardware Software Co-design of Embedded Systems (1999 - 2001), MHRD (Rs. 10.00 Lakhs)\r\nVision based activity Monitoring for Surveillance applications, Naval Research Board (2006 - 09), MHRD R&D (Rs. 12.00 Lakhs) \r\nDevelopment of tool for Detection of XML based injection vulnerabilities in Web Applications (2014-2016), MCIT - New Delhi (Rs. 38.16 Lakhs)', '1. Pais, A. R., J. D\'Souza, and R. M. Reddy. \"Super-resolution video generation algorithm for surveillance applications.\" The Imaging Science Journal 62.3 (2014): 139-148.\r\n\r\n2. Pais, Alwyn R., and Shankar Joshi. \"A new probabilistic rekeying method for secure multicast groups.\" International Journal of Information Security 9.4 (2010): 275-286.\r\n\r\n3. Talukder, Asoke K., Vineet Kumar Maurya, Babu G. Santhosh, Ebenezer Jangam, Sekhar V. Muni, K. P. Jevitha, Samanta Saurabh, and Alwyn Roshan Pais. \"Security-aware Software Development Life Cycle (SaSDLC)-Processes and tools.\" In Wireless and Optical Communications Networks, 2009. WOCN\'09. IFIP International Conference on, pp. 1-5. IEEE, 2009.\r\n\r\n4. Godbole, Rahul M., and Alwyn R. Pais. \"Secure and efficient protocol for mobile payments.\" Proceedings of the 10th international conference on Electronic commerce. ACM, 2008.\r\n\r\n5. Darapureddi, Avinash, Radhesh Mohandas, and Alwyn R. Pais. \"Throttling DDoS attacks using discrete logarithm problem.\" Security and Cryptography (SECRYPT), Proceedings of the 2010 International Conference on. IEEE, 2010.', '1.National Merit Scholarship, Govt of India, 1989-1995\r\n2.QIP fellowship, MHRD, Govt of India, 2002-04\r\n3.ISEA-Travel Fellowship, MCIT-New Delhi, 2007, 2009\r\n4.Best Paper Award, ICIP-2010, Bangalore\r\n5.Best Paper Award, SECURWARE 2011, France\r\n6.Marqus whos’ who 2011\r\n7.Best Paper Award, CSI-Convention-2011.', ),
(2, 'Mahendra Pratap Singh', '1234', 'Faculty', ' \r\n+91-824-2473402', '2009-01-06', '10 years 6 months at NITK', 'Faculty', 'ORCID iD: \r\nhttps://orcid.org/0000-0002-6251-8097\r\nSCOPUS ID: \r\nhttps://www.scopus.com/authid/detail.uri?authorId=57026713500\r\nGoogle Scholar: \r\nhttps://scholar.google.co.in/citations?hl=en&user=VxrVr6UAAAAJ', 'Ph.D., Computer Security, Indian Institute of Technology, Kharagpur (Ongoing)\r\n\r\nM.E., Computer Science and Engineering, 2007.\r\n\r\nB.Tech., Computer Science and Engineering, 2005.', 'Computer Security\r\nInformation Security\r\nDatabase Security\r\nWireless Network Security\r\n\r\n', ' Name of the Project: Development of Tool for Detection of Application Layer DDoS Attacks on Web Applications\r\nFunding Agency: Ministry of Electronic and Information Technology (MeitY)\r\nPrincipal Investigator: Dr. P. Santhi Thilagam\r\nCo-investigator(s): Dr. Alwyn R. Pais, Mr. Mahendra Pratap Singh\r\nProject Duration: 2017-19\r\nFunding Amount: Rs. 29.78 Lakhs\r\n\r\n2. Name of the Project: CP-ABE Scheme with Decryption Keys of Constant Size using ECC with Expressive Threshold Access\r\nFunding Agency: Department of Science and Technology-Interdisciplinary Cyber-Physical Systems (DST-ICPS)\r\nPrincipal Investigator: Dr. Alwyn R. Pais\r\nCo-investigator(s): Dr. P. Santhi Thilagam, Mr. Mahendra Pratap Singh\r\nProject Duration: 2018-21\r\nFunding Amount: Rs. 33.26 Lakhs', 'JOURNAL:\r\n\r\nMahendra Pratap Singh, Shamik Sural, Jaideep Vaidya and Vijayalakshmi Atluri, “Managing Attribute-Based Access Control Policies in a Unified Framework using Data Warehousing and In-Memory Database”, Computer & Security, vol. 86, page no. 183-205, June 2019. (Impact Factor-3.06)\r\nT. R. Srinath and Mahendra Pratap Singh, “Anonymity and Verifiability in Multi-Attribute Reverse Auction”, International Journal of Information Technology Convergence and Services,  Vol. 1, No. 4, August 2011.\r\nSuhas J. Manangi, Parul Chaurasia and Mahendra Pratap Singh, “Analysis of Security Features in 5 Layer Internet Model”, International Journal of Computer Science and Engineering, Vol. 02, No. 03, Page no. 785-789, May 2010.\r\nSuhas J. Manangi, Parul Chaurasia and Mahendra Pratap Singh, “Simplified AES for Low Memory Embedded Processors”,International Journal of Advanced Research in Computer Science, Vol. 10, No. 14, Page no. 7-11, October 2010.\r\nCONFERENCE:\r\n\r\nMahendra Pratap Singh, Sudharsan S and Vani M., “ARBAC: Attribute-Enabled Role Based Access Control Model”, 2nd International Conference on Security and Privacy, Page no. 97-111, January 9-11, 2019.\r\nJincy Johny and Mahendra Pratap Singh, “Network Dominating Attack Detection and Mitigation”, 2nd Conference on Information and Communication Technology, October 26-28, 2018.\r\nMahendra Pratap Singh, “Attribute Value Hierarchies and Constraints Specification in Attribute Based Access Control Model”, 14thInternational Conference on Privacy, Security and Trust, Page no. 35-41, December 12-14, 2016.\r\nMahendra Pratap Singh, Shamik Sural, Vijayalakshmi Atluri, Jaideep Vaidya and Ussama Yakub, “Managing Multi-dimensional Multi-granular Security Policies using Data Warehousing”, 9th International Conference on Network and System Security, Page no. 221-235, November 3-5, 2015.\r\nManesh T., Brijith B. and Mahendra Pratap Singh, “AnImproved Approach towards Network Forensic Investigation of HTTP and FTP Protocols”, International Conferenceon Parallel, Distributed Computing Technologies and Applications, Page no. 385-392, September 23–25, 2011.\r\nSuhas J. Manangi, Parul chaurasia and Mahendra Pratap Singh, “Elliptic Curve Cryptographic Security in Transmission Control Protocol”, 2nd International Conference on Computing Communication and Networking Technologies (ICCCNT), 2010.\r\nSuhas J. Manangi, Parul chaurasia and Mahendra Pratap Singh, “Fast Generation of Pseudo-Random Cryptographic Key using Variable Speed String Rotations”, Vol.1, Issue 1, Page no. 23-27, 2010.\r\nSuhas J. Manangi, Parul chaurasia and Mahendra Pratap Singh, ”Merging of RC5 with AES-Incorporating more Flexibility and Security to AES”, 12th International Conference on Information Technology (ICIT), Page no. 70-75, December 21-24, 2009.\r\nMahendra Pratap Singh and R.Venkatesan,”Correction of Distortion for Images of Printed Materials”, International Conference on Computer Science (ICCS), No. 26, March 21-23, 2007.', 'QIP Fellowship from MHRD, Government of India, (2013 - 2016)\r\nMHRD Mexican Government Scholarship (2010) ', );
INSERT INTO `people` (`ID`, `Name`, `password`, `Role`, `Contact Details`, `Date of joining`, `Experience`, `Designation`, `Author Identifers`, `Academic Background`, `Area of Interest`, `Significant Projects`, `Significant Publications`, `Achivements`, `image`) VALUES
(3, 'Biswajit R Bhowmik', '1234', 'Faculty', '+91-824-247-3164\r\n+91-824-247-3044', '2019-12-02', ' \r\n9 Years.', 'Faculty', 'ORCID iD: \r\n0000-0001-7923-9767\r\nWeb of Science: \r\nU-3922-2018\r\nSCOPUS ID: \r\n56825426700\r\nGoogle Scholar: \r\nxq31CXAAAAAJ', 'Ph.D.: Computer Science and Engineering, Indian Institute of Technology Guwahati, 2018.\r\n\r\nM.Tech: Computer Science and Engineering, National Institute of Technology Durgapur, 2010.\r\n\r\nB.Tech (Hons.): Information Technology, Vidyasagar University Midnapore,  2004.', 'Specific Area: Network-on-Chip (NoC) – 2D, 3D, Wireless, and Photonic.\r\n\r\nBroad Area: Testing and Fault-Tolerance, Hardware Security, Formal Verification, and Cyber-Physical Systems.\r\n\r\nExpanded Area: Computer Systems and Architecture, Computational Geometry, Machine Learning, and Distributed Systems.', 'To Be Updated Soon...', 'Institute Research Scholars are selected through Ph.D. Admission Process held Twice in a Year normally for July and December sessions.\r\n \r\n\r\nBesides, I am looking for a couple of\r\n\r\n\r\nInterns in a 2-3 month duration. Candidates must have good knowledge in a Programming Language like C, C++, Verilog/VHDL.\r\nFinal Year B.Tech (CSE, ECE), M.Tech (CSE, ECE), BCA, MCA, BSc (CS), MSc (CS) students who wish to continue Final Year Project in my areas of interest and enrolled at an institute/university near to the NIT Karnataka.\r\nPh.D. students who would like to enroll (or already enrolled) at an institute/university other than NIT Karnataka and continue research works in my areas of interest in collaboration with a Supervisor at the home institution.', 'Recipient of the First Prize from Springer-Nature for Best Oral Presentation in Computer Science and Engineering Track at the 4th Annual Research Conclave 2018 organized by IIT Guwahati, March 8–11, 2018.\r\nEarned the Best Paper Award in Computer Science and Engineering Track (Oral) at the 4th Annual Research Conclave 2018 organized by IIT Guwahati, March 8–11, 2018.\r\nInstitute First (PhD) Student of a Research Paper published in the Premier and Prestigious Conference: ACM/IEEE DATE 2017.\r\nRecipient of Project Fellow Assistantship sponsored by MeitY, Govt. of India, August 2016 – February 2017.\r\nRecipient of MHRD Scholarship, Govt. of India as IITG Institute Assistantship for Doctoral Programme, July 2011 – July 2016.\r\nInstitute First (PhD) Student of a Research Paper published in the Premier and Prestigious Conference: IEEE MASCOTS 2016.\r\nRecipient of International Travel Grant partially sponsored by DeitY, Govt. of India to attend the 24th IEEE MASCOTS 2016.\r\nRecipient of International Travel Grant partially sponsored by DeitY, Govt. of India to attend 28th IEEE TENCON 2016.\r\nRecipient of ACM-IARCS Student Travel Grant to attend 20th IEEE/ACM DATE 2017.\r\nRecipient of Student Travel Grant Award from the 29th IEEE SMC 2016.\r\nRecipient of International Travel Grant sponsored by MeitY, Govt. of India to attend 22nd IEEE IOLTS 2016.\r\nRecipient of Teaching Assistant Certificate by National Programme on Technology Enhanced Learning (NPTEL), Ministry of HRD, Govt. of India, Jul–Oct, 2016.\r\nEarned the Best Paper Award at the IEEE TENCON 2015.\r\nEarned the Young Scientist Award at the IEEE TENCON 2015.\r\nRecipient of International Travel Grant sponsored by MeitY, Govt. of India to attend 28th IEEE SMC 2015.\r\nRecipient of MHRD Scholarship, Govt. of India, as NITDgp Institute Assistantship for Post Graduation, June 2008 – April 2010.\r\n\r\n', );
